import React from 'react';
import './SearchImage.scss';
import {withRouter} from 'react-router-dom';

const SearchImage = ({data, url, history}) => {
    return (
        <div className="searchimage">
            <img src={url} alt={data.title} onClick={() => history.push(`/searchpage/${data.nasa_id}`)} />
        </div>
    );
}

export default withRouter(SearchImage);
